'use strict';(function(){const indexCfg={cache:true};indexCfg.doc={id:'id',field:['title','content'],store:['title','href'],};const index=FlexSearch.create('balance',indexCfg);window.bookSearchIndex=index;index.add({'id':0,'href':'/docs/home/','title':"Home",'content':"A Random Walk Through Computer Science #!/usr/bin/python print(\u0026#34;Welcome to my personal site. Have a good day！ 😄\u0026#34;) I\u0026rsquo;m Haoze SONG, an undergraduate student in Computer Science at the University of Science and Technology of China. My research interests are Distributed System, Operating System and Computer Network. Here is the site where I randomly write some seriousness or nonsense: a random walk through computer science.\nRecent Project  Geo-Distributed-Transactions : A Low-Latency and High-Scalabity Protocol for Inter-Datacenter Transaction (Advised by HeMing Cui)  Useful Links  Courses of Computer Science ...   Operating SYS MIT 6.828 Distributed SYS MIT 6.824 Distributed SYS NYU G22.3033 Distributed SYS UW CSE452      Some tech sites of Programming Tools ...   Plot using Matplotlib Latex QuickStart MakeFile QuickStart GIT QuickStart      Lab Links ...   HKU Machine Manage USTC-SYS Reading Group SJTU IPADS UW SYS     "});index.add({'id':1,'href':'/posts/creating-a-new-theme/','title':"Notes for MIT 6.824 Introduction",'content':"Introduction Goal  Parallelism Fault Tolerance Physical Security / Isolated  Hide the distributed nature;\nBuild an interface that looks an application like a non-distributed system ;\nChallenge   Concurrent program\n Complex interactions Timing-dependent stuff    Network Failure / Partial Failure\n  Performance\n  Infrastructure/Abstractions  Storage Communication eg:RPC Computation eg: MapReduce  Implementation RPC, Threads, concurrency control\nTopic   Performance\n Scalability : 2x computers -\u0026gt; 2x throughput    Fault Tolerance\n Availability Recoverability  eg: checkpoint, NV storage, Replication\n  Consistency\nProblems: Different Version, Multi copy\nType: Strong consistency, weak consistency\u0026hellip;\n  Mapreduce Framework   Map Function\nMap(K,V) split V into words for each word w in words emit (w,\u0026#39;1\u0026#39;)   Reduce Function\nReduce(K,V) emit (len(v))   "});index.add({'id':2,'href':'/docs/home/curriculum-vitae/','title':"Curriculum Vitae",'content':"Curriculum Vitae 🎓 Education Bachelor of Computer Science and Technology (Hon), Computer Science, Unviersity of Science and Technology of China (2020)\n Thesis: “A Low-Latency and High-Scalabity Protocol for Inter-Datacenter Transaction\u0026rdquo; Supervisor: Chen Li \u0026amp; Heming Cui Award: University of Science and Technology of China Honor Scholarship 2016  ✍️ Research 📰 Journal Article 📄 Conference Paper Optimizing quantum programs against decoherence: delaying qubits into quantum superposition (TASE 2019) , YuZhang ∗ , HaoweiDeng, QuanxiLi, HaozeSong and LeihaiNie\n🏆 Grants \u0026amp; Awards  Silver Outstanding Student Scholarship, Unviersity of Science and Technology of China, 2017,2018,2019 (Top 8%) First Class Honor Class Scholarship , Unviersity of Science and Technology of China, 2019 (Top 5%) Second Class Honor Class Scholarship, Unviersity of Science and Technology of China, 2018 (Top 10%)  👨🏻‍🏫 Teaching Portfolio Semester 1, 2020 - University of Science and Technology of China\n Operating System  👨🏻‍💼 Professional Experience USTC-SYS Reading Group - participant (Mar 2019 - present)\n  The Systems Reading Group provides an opportunity for students, researchers and faculty to discuss and keep abreast of current research in systems research, and to learn by example how to do high-quality systems research.\n  We select papers covering system topics and published at top system conferences such as OSDI, SOSP, ASPLOS, SIGMOD, VLDB, ATC, EuroSys, NSDI, FAST etc in the recent 3 years.\n  💪 Technical Skills Computer Languages: C, C++, Java, Python\nProtocols \u0026amp; APIs: TCP, UDP, Socket\nTools: Latex, Vim, CMake, LLVM, Git\n"});index.add({'id':3,'href':'/posts/','title':"Blog",'content':""});index.add({'id':4,'href':'/docs/','title':"Docs",'content':""});})();